import time
import heapq

class solution():
    def smallest_range(self, nums) ->[]:
        cur_max = -100000
        nl = len(nums)
        idxs = [ 0 for i in range(nl) ]
        left, right = min([ nums[i][-1] for i in range(nl) ]), max([ nums[i][-1] for i in range(nl) ])
        d = right - left
        
        print('start:', time.time())
        top_heap = [ [nums[i][0], i] for i in range(nl) ]
        heapq.heapify(top_heap)
        cur_max = max(cur_max, heapq.nlargest(1, top_heap)[0][0])
        print('init heap:', time.time())

        while idxs != [ len(l) - 1 for l in nums ]:
            min_node = heapq.heappop(top_heap)
            cur_min = min_node[0]
            if cur_max - cur_min < d or (cur_max - cur_min == d and cur_min < left):
                left, right, d = cur_min, cur_max, cur_max - cur_min

            min_idx = min_node[1]
            if idxs[min_idx] + 1 >= len(nums[min_idx]):
                print('exit')
                break
            else:
                idxs[min_idx] += 1
                next_num = nums[min_idx][idxs[min_idx]]
                cur_max = max(cur_max, next_num)
                heapq.heappush(top_heap, [next_num, min_idx])
        print('end loop:', time.time())

        return [left, right]
